B.Wu=new A.i3("Plant Whisperer","Blog mobile pour pr\xe9senter des plantes et leurs bienfaits","Plant Whisperer est une application dans un style blog qui permet d'ajouter des plantes avec diverses informations.\nSur cette application nous pourrons retrouver un syst\xe8me de contribution, n'importe qui peut ajouter une plante avec ses informations dessus qui devront par la suite \xeatre valid\xe9 par un mod\xe9rateur.\nNous avons aussi la possibilit\xe9 de rechercher des plantes et de les trier par contributions, cat\xe9gories, etc.\nJ'ai pu en apprendre beaucoup sur la gestion des contributions dans une base de donn\xe9es, en plus des filtres de recherche.","plant_whisperer.jpg","plant_whisperer_2.jpg","https://github.com/NzoSifou/plant_whisperer",0,"plantWhisperer")
B.Wv=new A.i3("NeoGate","Projet de porte connect\xe9e et securis\xe9e","NeoGate est une application et un ESP32 permettant de controller diff\xe9rents module afin de g\xe9rer une porte \xe0 distance ou physiquement. C'est un projet de porte connect\xe9e qui ne s'ouvre uniquement en la pr\xe9sence d'un badge NFC autoris\xe9. De plus, une option de maintien de la porte ouverte est disponible avec un bouton physique ou depuis l'application. \xc0 partir de celle-ci, nous pouvons g\xe9rer la porte \xe0 distance, comme l'ouvrir sans badge NFC (car il faut \xeatre authentifi\xe9 sur l'application), mais encore ajouter ou supprimer des badges NFC dit \"Autoriser\" pour ouvrir la porte.\nCe projet m'a permis d'en apprendre \xe9norm\xe9ment sur la communication entre un ESP32 et une Firebase (Realtime Database), ainsi que la gestion des diff\xe9rents modules d'un ESP32.","neogate.jpg","neogate_2.jpg","https://forge.univ-lyon1.fr/WOT_BUT3MOB_2025/groupe-11",1,"neoGate")
B.Wx=new A.i3("Orienteering","Interactivit\xe9 et personnalisation pour des courses d'orientation","Orienteering est une application li\xe9 \xe0 des ESP32 qui communique avec celle-ci. L'objectif de cette application est de permettre de concevoir une course avec diff\xe9rentes \xe9tapes enti\xe8rement personnalisable avec ou sans la pr\xe9sence de l'application mobile.\nL'application mobile permet \xe0 l'utilisateur de rendre la course interactive, c'est-\xe0-dire qu'\xe0 chaque fois que l'utilisateur pr\xe9sentera son badge \xe0 chaque balise (chaque \xe9tape de la course), l'application r\xe9agira en faisant augmenter son nombre de balise trouv\xe9es et donc mettra \xe0 jour son classement en temps r\xe9el, et lui posera une question (QCM) vis-\xe0-vis de la balise qu'il vient de scanner avec une animation en plus.\nJ'ai pu renforcer mes connaissances sur la communication entre Firebase et Flutter, notamment avec les syst\xe8mes de listener. J'ai aussi pu apprendre a g\xe9rer des QR Code avec une page personnalis\xe9e (ce que je ne savais pas faire avant).","orienteering.jpg","orienteering_2.jpg","https://iutbg-gitlab.iutbourg.univ-lyon1.fr/sae-but31/2024-25-mobile/course-orientation",2,"orienteering")
B.Ww=new A.i3("Forgather","Propose des activit\xe9s \xe0 faire autour de chez soi","Forgather est une application dans le style d'un Google Maps mais avec des d\xe9tails uniquement sur les activit\xe9s \xe0 faire autour de chez soi, elle permet de trouver facilement et rapidement des activit\xe9s \xe0 faire dans un rayon donn\xe9e (pratique si on souhaite y aller en voiture ou \xe0 pied) et \xe0 une position donn\xe9e (soit la position actuelle de l'utilisateur, soit la position pr\xe9f\xe9r\xe9e de l'utilisateur, exemple : chez soi).\nL'objectif \xe9tait d'afficher la fourchette de prix et les horaires d'ouverture et de fermeture de chaque activit\xe9 (bien que nous n'avons pas pu trouver d'API pour faire ceci, cela reste possible).\nCette application poss\xe8de une gestion de favoris, nous pouvons donc ajouter aux favoris nos activit\xe9s pr\xe9f\xe9r\xe9es.\nJe n'ai pas l'habitude de travailler avec la position actuelle de l'utilisateur ainsi qu'avec des cartes (comme Google Maps), c'est pourquoi j'ai pu acqu\xe9rir de nouvelles connaissances gr\xe2ce \xe0 cette application, autant pour r\xe9cup\xe9rer la position de l'utilisateur en temps r\xe9el que poru afficher les activit\xe9s avec des marqueurs sur la carte.","forgather.jpg","forgather_2.jpg","https://github.com/NzoSifou/forgather-flutter",3,"forgather")
